  - class: StructConfiguration
    values: [!!python/unicode 'structsdlevent__struct', !!python/unicode 'SDLEvent',
      !!python/unicode '', !!python/unicode 'sdlevent_struct', !!python/unicode "#ifndef\
        \ _INC_STRUCT_SDLEVENT\n#define _INC_STRUCT_SDLEVENT\n\ntypedef struct sdlevent_struct\
        \ {\n  int type;\n  int what;\n  int data[12];\n} sdlevent_struct;\n\n#endif",
      !!python/unicode "import HGamer3D.Data\n\nimport HGamer3D.Bindings.SDL2.EnumSDLEventType\n\
        import HGamer3D.Bindings.SDL2.EnumSDLKeymod\nimport HGamer3D.Bindings.SDL2.EnumSDLScancode\n\
        import HGamer3D.Bindings.SDL2.EnumSDLWindowEventID\n\nimport Control.Monad\n\
        import Control.Applicative\nimport Control.Exception\n\nimport qualified Data.ByteString.Char8\
        \ as BSC8\nimport qualified Data.String.UTF8 as UTF8\n\nimport Foreign.Storable\n\
        import Foreign.C.Types\nimport Foreign.Ptr\n\ntype Keycode = Word32\ntype\
        \ Keymod = Word16\n\ntype MouseID = Int\n\ndata SDLButton = SDLButtonLeft\
        \ | SDLButtonRight | SDLButtonMiddle | SDLButtonX1 | SDLButtonX2 | SDLButtonNumber\
        \ Int deriving (Eq, Show)\n\n_getButton :: Word8 -> SDLButton\n_getButton\
        \ w = case w of\n   1 -> SDLButtonLeft\n   2 -> SDLButtonMiddle\n   3 -> SDLButtonRight\n\
        \   4 -> SDLButtonX1\n   5 -> SDLButtonX2\n   _ -> SDLButtonNumber ((fromIntegral\
        \ . toInteger) w)\n\ndata SDLEvent = EvtKeyUp TimeMS Window EnumSDLScancode\
        \ Keycode Keymod |\n             EvtKeyDown TimeMS Window EnumSDLScancode\
        \ Keycode Keymod |\n             EvtText TimeMS Window String | \n       \
        \      EvtQuit TimeMS |\n             EvtWindow TimeMS Window EnumSDLWindowEventID\
        \ Int Int |\n             EvtMouseButtonDown TimeMS Window MouseID SDLButton\
        \ Int Int |\n             EvtMouseButtonUp TimeMS Window MouseID SDLButton\
        \ Int Int |\n             EvtMouseMotion TimeMS Window MouseID Int Int Int\
        \ Int | \n             EvtCommon TimeMS EnumSDLEventType |\n             EvtNotValid\n\
        \ninstance Storable SDLEvent where\n  sizeOf _ = 56\n  alignment _ = 4\n \
        \ \n  peek p = do\n   typ  <- (peekByteOff p 0 :: IO CUInt)\n   time <- (peekByteOff\
        \ p 4 :: IO CUInt)\n   Control.Exception.catch (do\n      let evttyp = (toEnum\
        \ . fromIntegral . toInteger) typ  -- this first throws exception if enum\
        \ not ok !\n      let t = TimeMS ((fromIntegral . toInteger) time)\n\n   \
        \   case (evttyp) of\n         SDL_QUIT -> return $ EvtQuit t\n         SDL_KEYDOWN\
        \ -> EvtKeyDown <$> return t\n                            <*> fmap (Window\
        \ . fromIntegral . toInteger) (peekByteOff p 8 :: IO CUInt)\n            \
        \                <*> fmap (toEnum . fromIntegral . toInteger) (peekByteOff\
        \ p 16 :: IO CUInt)\n                            <*> fmap (toEnum . fromIntegral\
        \ . toInteger) (peekByteOff p 20 :: IO Keycode)\n                        \
        \    <*> fmap (toEnum . fromIntegral . toInteger) (peekByteOff p 24 :: IO\
        \ Keymod)\n         SDL_KEYUP -> EvtKeyUp <$> return t\n                 \
        \           <*> fmap (Window . fromIntegral . toInteger) (peekByteOff p 8\
        \ :: IO CUInt)\n                            <*> fmap (toEnum . fromIntegral\
        \ . toInteger) (peekByteOff p 16 :: IO CUInt)\n                          \
        \  <*> fmap (toEnum . fromIntegral . toInteger) (peekByteOff p 20 :: IO Keycode)\n\
        \                            <*> fmap (toEnum . fromIntegral . toInteger)\
        \ (peekByteOff p 24 :: IO Keymod)\n         SDL_WINDOWEVENT -> EvtWindow <$>\
        \ return t\n                            <*> fmap (Window . fromIntegral .\
        \ toInteger) (peekByteOff p 8 :: IO CUInt)\n                            <*>\
        \ fmap (toEnum . fromIntegral . toInteger) (peekByteOff p 12 :: IO Word8)\n\
        \                            <*> fmap (fromIntegral . toInteger) (peekByteOff\
        \ p 16 :: IO CInt)\n                            <*> fmap (fromIntegral . toInteger)\
        \ (peekByteOff p 20 :: IO CInt)\n         SDL_TEXTINPUT -> EvtText <$> return\
        \ t\n                            <*> fmap (Window . fromIntegral . toInteger)\
        \ (peekByteOff p 8 :: IO CUInt)\n\t\t\t    -- this text conversion is neccessary,\
        \ the C-String of the event contains a UTF8-encoding\n\t\t\t    -- with BSC8.pack\
        \ the string is converted to ByteString without additional UTF8-encoding\n\
        \t\t\t    -- the remaining decoding, creates a normal (Unicode) Haskell string\
        \ from that\n                            <*> fmap (UTF8.toString . UTF8.fromRep\
        \ . BSC8.pack) (peekCAString (castPtr (plusPtr p 12)) )\n         SDL_MOUSEBUTTONDOWN\
        \ -> EvtMouseButtonDown <$> return t\n                            <*> fmap\
        \ (Window . fromIntegral . toInteger) (peekByteOff p 8 :: IO CUInt)\n    \
        \                        <*> fmap (fromIntegral . toInteger) (peekByteOff\
        \ p 12 :: IO CUInt )\n                            <*> fmap _getButton (peekByteOff\
        \ p 16 :: IO Word8)\n                            <*> fmap (fromIntegral .\
        \ toInteger) (peekByteOff p 20 :: IO CInt)\n                            <*>\
        \ fmap (fromIntegral . toInteger) (peekByteOff p 24 :: IO CInt)\n        \
        \ SDL_MOUSEBUTTONUP -> EvtMouseButtonUp <$> return t\n                   \
        \         <*> fmap (Window . fromIntegral . toInteger) (peekByteOff p 8 ::\
        \ IO CUInt)\n                            <*> fmap (fromIntegral . toInteger)\
        \ (peekByteOff p 12 :: IO CUInt )\n                            <*> fmap _getButton\
        \ (peekByteOff p 16 :: IO Word8)\n                            <*> fmap (fromIntegral\
        \ . toInteger) (peekByteOff p 20 :: IO CInt)\n                           \
        \ <*> fmap (fromIntegral . toInteger) (peekByteOff p 24 :: IO CInt)\n    \
        \     SDL_MOUSEMOTION -> EvtMouseMotion <$> return t\n                   \
        \         <*> fmap (Window . fromIntegral . toInteger) (peekByteOff p 8 ::\
        \ IO CUInt)\n                            <*> fmap (fromIntegral . toInteger)\
        \ (peekByteOff p 12 :: IO CUInt )\n                            <*> fmap (fromIntegral\
        \ . toInteger) (peekByteOff p 20 :: IO CInt)\n                           \
        \ <*> fmap (fromIntegral . toInteger) (peekByteOff p 24 :: IO CInt)\n    \
        \                        <*> fmap (fromIntegral . toInteger) (peekByteOff\
        \ p 28 :: IO CInt)\n                            <*> fmap (fromIntegral . toInteger)\
        \ (peekByteOff p 32 :: IO CInt)\n         _ -> return $ EvtCommon t evttyp\n\
        \               ) ((\\e -> return EvtNotValid) ::(SomeException -> IO SDLEvent))\n\
        \n  poke p evt = error \"poke of SDLEvent not implemented\"\n    \n{#pointer\
        \ *sdlevent_struct as SDLEventPtr -> SDLEvent #}\n\nwithSDLEvent :: SDLEvent\
        \ -> (SDLEventPtr -> IO b) -> IO b\nwithSDLEvent = with\n\npeekSDLEvent ::\
        \ SDLEventPtr -> IO SDLEvent\npeekSDLEvent = peek\n", !!python/unicode 'SDL_Event',
